import { Component } from 'react'; 
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor(){
    super();
    this.state = {
      name: {firstName: 'John', lastName: 'James'},
      country: 'Germany'
    }
  }
  render(){
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          I am {this.state.name.firstName} {this.state.name.lastName} from {this.state.country}.
        </p>
        <button onClick={()=>{
          this.setState(()=>{
            return{
              name : {firstName: 'Paul', lastName: ''},
              country: 'Canada'
            }
          }, ()=>{
            console.log('latest state:-',this.state)
          })
        }}>~click Me~</button>
      </header>
    </div>
  );
  }

}

export default App;
